function searchQuery(props) {

    if (!props.apiData.results) {
      // If the API request isn't completed return "loading...""
      return <p>Loading...</p>;
    } else {

      // Extract the data from the API response
      let data = props.apiData.results;

      return (
        <table>
          <thead>
            <tr>
              <th>Country</th>
              <th>Population</th>
              <th>Population Growth</th>
              <th>Continent</th>
            </tr>
          </thead>
          <tbody>
            {data.map((row, index) => (
              <tr key={index}>
                <td>{row.Country}</td>
                <td>{row.Population}</td>
                <td>{row.PopulationGrowth}</td>
                <td>{row.Continent}</td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    }
  }


  export default Table;
